import { r as registerInstance, h } from './index-65ac344c.js';

const CampaignNews = class {
    constructor(hostRef) {
        registerInstance(this, hostRef);
    }
    componentDidLoad() {
        let url = `https://kclsu-heroku.herokuapp.com/newslist/${this.newsid}`;
        fetch(url)
            .then(res => res.json())
            .then(newsData => {
            this.data = newsData;
        });
    }
    render() {
        let news;
        if (this.data <= 0 || !this.data)
            news = h("p", null, "There is no current news.");
        else
            news = this.data.map(ob => h("news-card", { newstitle: ob.Title, newslink: ob.Url }));
        return (h("div", null, news));
    }
};

export { CampaignNews as campaign_news };
